import React from 'react'
import { base_url } from '../custom/httpCustomValues'
import { axios } from 'axios'

class Issue {
  async getIssue () {
    return await axios.get(base_url + '/issues')
  }
}

export default function getIssues () {
  return (
    <div>
      <ul>
        {' '}
        {this.getIssue().map(issue => {
          ;<li key={issue.id}> {issue.data} </li>
        })}{' '}
      </ul>{' '}
    </div>
  )
}
